import React, { useState } from "react";
import AdminTemplate from "../../../templates/AdminTemplate";
import useMascotaViewModel from "../../../viewmodels/useMascotaViewModel";
import Button from "../../../components/atoms/Button";
import { useNavigate } from "react-router-dom";

const ListarMascotasPage = () => {
  const [rut, setRut] = useState("");
  const navigate = useNavigate();

  const {
    mascotas,
    fetchMascotas,
    deleteMascota,
    loading,
  } = useMascotaViewModel(rut);

  const handleBuscar = async () => {
    if (!rut.trim()) return alert("Ingrese el RUT del cliente");
    await fetchMascotas();
  };

  const handleEliminar = async (id) => {
    if (!window.confirm("¿Eliminar esta mascota?")) return;
    await deleteMascota(id);
    await fetchMascotas(); // refrescar
  };

  return (
    <AdminTemplate>
      <main className="flex-grow-1" id="main-content" role="main">

        <div className="container-fluid py-4">
          {/* Breadcrumb */}
          <nav aria-label="breadcrumb" className="mb-3">
            <ol className="breadcrumb mb-0">
              <li className="breadcrumb-item"><a href="/admin">Administración</a></li>
              <li className="breadcrumb-item active" aria-current="page">Mascotas</li>
            </ol>
          </nav>

          <h1 className="h4 mb-4">Listado de Mascotas</h1>

          {/* Buscar por RUT */}
          <div className="d-flex gap-2 mb-4">
            <input
              className="form-control"
              placeholder="Ingrese RUT del cliente"
              value={rut}
              onChange={(e) => setRut(e.target.value)}
            />
            <Button label="Buscar" onClick={handleBuscar} />
          </div>

          {/* Tabla */}
          <div className="table-responsive">
            <table className="table table-bordered align-middle text-center">
              <thead className="table-light">
                <tr>
                  <th>Nombre</th>
                  <th>Especie</th>
                  <th>Raza</th>
                  <th>Edad</th>
                  <th>Peso</th>
                  <th>Acciones</th>
                </tr>
              </thead>

              <tbody>
                {loading && (
                  <tr>
                    <td colSpan="6">Cargando mascotas...</td>
                  </tr>
                )}

                {!loading && mascotas.length === 0 && (
                  <tr>
                    <td colSpan="6">No hay mascotas para este cliente.</td>
                  </tr>
                )}

                {!loading &&
                  mascotas.map((m) => (
                    <tr key={m._id}>
                      <td>{m.nombre}</td>
                      <td>{m.especie}</td>
                      <td>{m.raza}</td>
                      <td>{m.edad}</td>
                      <td>{m.peso}</td>
                      <td className="d-flex gap-2 justify-content-center">
                        <Button
                          label="Editar"
                          variant="secondary"
                          onClick={() =>
                            navigate(`/admin/clientes/mascotas/editar/${m._id}?rut=${rut}`)
                          }
                        />
                        <Button
                          label="Eliminar"
                          variant="danger"
                          onClick={() => handleEliminar(m._id)}
                        />
                      </td>
                    </tr>
                  ))}
              </tbody>
            </table>
          </div>
        </div>
      </main>
    </AdminTemplate>
  );
};

export default ListarMascotasPage;
